import React from 'react';

function HomePage({ onNavigate }) {
  return (
    <div className="HomePage">
      <h1>Welcome to Freelancer UI</h1>
      <button onClick={onNavigate}>Create New Freelancer</button>
    </div>
  );
}

export default HomePage;
